import Layout from '../components/Layout';
import 'bootstrap/dist/css/bootstrap.min.css';


export default () => (
    <Layout header="Next" title="Top page." >
        <div class="index-box">
            <span class="box-title">会社からの連絡</span>
            <p>ここに文章</p>
        </div>
    </Layout>
);
